import './RightSidePanelTableBody.css';
import React, { useState } from 'react';
import Orders from '../../data/Orders.json'

function RightSidePanelTableBody() {
    const [data, setdata] = useState(Orders)
  return (
        <table>
            <thead>
                <th>#</th>
                <th>Дата</th>
                <th>Статус</th>
                <th>Позиций</th>
                <th>Сумма</th>
                <th>ФИО покупателя</th>
            </thead>
            <tbody>
                {data.map((d)=>(
                    <tr key={d.id}>
                        <td>{d.id}</td>
                        <td>{d.created}</td>
                        <td></td>
                        <td>{d.positions}</td>
                        <td>{d.sum}</td>
                        <td>{d.name}</td>
                    </tr>
                ))
                }
            </tbody>
        </table>
  );
}

export default RightSidePanelTableBody;
